import * as React from "react";
import { Component } from "react";
import "./App.css";

import Main from "./components/Main";
import Video from "./util/Video";

type AppState = {
  apiResponse: string;
};

export default class App extends Component<{}, AppState> {
  state: AppState = {
    apiResponse: "",
  };

  testApi() {
    const url = "http://localhost:9000/testApi";
    fetch(url)
      .then((res) => res.text())
      .then((res) => this.setState({ apiResponse: res }));
  }

  // componentWillMount() {
  //   this.testApi();
  // }

  render() {
    const testVideos = [
      new Video(
        "futsal-shuffle.img",
        "Futsal Shuffle",
        "Lil Uzi Vert",
        100000000900,
        new Date(),
        "1"
      ),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
      new Video("1", "1", "1", 1, new Date(), "1"),
    ];
    return (
      <>
        <Main title="Recently Played on Spotify" videos={testVideos} />
      </>
    );
  }
}
